import React from "react";
import "./css/App.css";
import Main from "./Main";
import {
  ThemeProvider,
  createTheme,
  CssBaseline,
  useMediaQuery,
} from "@mui/material";
function App() {
  const theme = createTheme({
    palette: {
      background: {
        default: "#fcfaea",
      },
      primary: {
        main: "#e86000",
      },
      text: { primary: "#ff9800" },
    },
  });

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Main />
    </ThemeProvider>
  );
}

export default App;
